    playbackData.comments = {"a8fb04f3-2a95-42d0-a3f0-3f227e17c4e5":[{"id":"b6d0f8be-2dc5-4087-9db4-8874d2ae4986","displayCommentEventId":"a8fb04f3-2a95-42d0-a3f0-3f227e17c4e5","displayCommentEventSequenceNumber":0,"developerGroupId":"9a3a083b-53c5-4e57-a9e9-bb2b3c88f2cf","timestamp":1730745131232,"commentText":"A playback introducing some basics for dealing with dates and times, including how to extract certain parts of them, specify their formatting, and make them more human readable.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"37b3ae92-314b-4793-9b5d-3ab14cd72f87":[{"id":"989bd5a6-b1e5-4d79-b7f4-2c66ee662bab","displayCommentEventId":"37b3ae92-314b-4793-9b5d-3ab14cd72f87","displayCommentEventSequenceNumber":122,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730746268387,"commentText":"Here, we have two new packages, as the comments suggest.&nbsp; The first, <span style=\"font-family: Courier;\">readxl</span>, has nothing specific to do with dates and times, the main focus of this playback.&nbsp; It is, however, useful if you wish to read in from an Excel file instead of a csv file.&nbsp; The second, the <span style=\"font-family: Courier;\">hms</span> package, is for dealing with time data (hms stands four <span style=\"font-weight: bold;\">h</span>our, <span style=\"font-weight: bold;\">m</span>inute, <span style=\"font-weight: bold;\">s</span>econd)","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["hms","readxl"],"questionCommentData":null}],"0aabacf2-c84f-4e76-8b44-e257e7dd676b":[{"id":"07d1462e-7be5-4db0-ae2d-128ec751e5ce","displayCommentEventId":"0aabacf2-c84f-4e76-8b44-e257e7dd676b","displayCommentEventSequenceNumber":189,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730746293247,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1730746289550-DatesAndTimes.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"09c5e8c1-c9ea-4a63-8ddb-877c52731e57":[{"id":"926e9711-4fd3-4700-953c-e6d214e8271f","displayCommentEventId":"09c5e8c1-c9ea-4a63-8ddb-877c52731e57","displayCommentEventSequenceNumber":433,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730746614315,"commentText":"One of the biggest complications with dealing with dates and times is that people often format them differently.&nbsp; The <a href=\"https://r4ds.hadley.nz/datetimes\">book</a> gives a nice example with the date 01/02/15.&nbsp; Does this mean January 2, 2015, February 15, 2001, or February 1, 2015?&nbsp; &nbsp;<div><br></div><div>Because formatting of dates is inconsistent, it is often the case that our <span style=\"font-family: Courier;\">read_csv()&nbsp;</span>function cannot determine a column that is a date and know immediately how to read that column in.&nbsp; As you can see in the image below, the <span style=\"font-family: Courier;\">read_csv()</span> function here correctly know that <span style=\"font-family: Courier;\">transaction_time</span> was a time data type, but it things <span style=\"font-family: Courier;\">transaction_date</span> is a character string.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730746491591-coffee_csv.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"acbec32e-3a71-4435-8fe1-a636d7765e45":[{"id":"33d79ba3-8fb2-412e-b174-9a426170fbc7","displayCommentEventId":"acbec32e-3a71-4435-8fe1-a636d7765e45","displayCommentEventSequenceNumber":558,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730746953023,"commentText":"Excel is very \"good\" (see funny below) at determining / reading dates and times, as doing this properly is very important!&nbsp; Saving a file as an Excel file (<span style=\"font-family: Courier;\">.xlsx</span>) may preserve date and time formatting, helping us read them in properly.<div><br></div><div>If you haven't worked with Excel much, how this changes things if we read in from an Excel sheet via<span style=\"font-family: Courier;\"> read_excel</span> (housed in the <span style=\"font-family: Courier;\">readxl</span> package) may surprise you.&nbsp; If you have worked with Excel, you may be less surprised.&nbsp; What happened here is Excel went too far, upgrading <span style=\"font-style: italic;\">everything</span>&nbsp;to a date-time object and adding an arbitrary default date to the <span style=\"font-family: Courier;\">transaction_time</span> column.&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730746764606-exceldates.jpg","media/images/1730746776574-coffee_excel.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["date-time","read_excel","readxl","image"],"questionCommentData":null}],"342f260f-485d-478e-9427-34ea0252172b":[{"id":"2d05f61b-be54-4953-b5fb-17dc802c3bf6","displayCommentEventId":"342f260f-485d-478e-9427-34ea0252172b","displayCommentEventSequenceNumber":632,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730747505774,"commentText":"When we realize that <span style=\"font-family: Courier;\">read_csv()</span> isn't correctly inferring the types of some columns, we can invoke its optional <span style=\"font-family: Courier;\">col_types </span>argument, where we provide the column names we wish to specify a data type for (here, <span style=\"font-family: Courier;\">transaction_date</span>) and then specify the column type on the other side of the equal sign with a <span style=\"font-family: Courier;\">col_</span> function; here, <span style=\"font-family: Courier;\">col_date()</span>.&nbsp;<div><br></div><div>So all together, the syntax should match:<br><span style=\"font-family: Courier;\">col_types = cols(col_name = col_datatype())</span></div><div><br></div><div>All of the above appears inside the <span style=\"font-family: Courier;\">read_csv()</span> function.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["col_types","cols"],"questionCommentData":null}],"87eb30c7-0e49-4c5e-b261-7d64a9a2b50a":[{"id":"3ef26c21-f3cb-4b3b-b565-1d1c1ce2e9e1","displayCommentEventId":"87eb30c7-0e49-4c5e-b261-7d64a9a2b50a","displayCommentEventSequenceNumber":644,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730747853135,"commentText":"We aren't quite done with the previous comment.&nbsp; Because dates can be specified in so many ways, we need to tell the computer how the dates (it now knows the items in the <span style=\"font-family: Courier;\">transaction_date</span> column are dates) are formatted; i.e. what do the years, months, and days look like, how are they ordered, and how are they combined?&nbsp;&nbsp;<div><br></div><div>Our dates look like 1-2 digits for the month, 1-2 digits for the day, and four digits for the year, separated by slashes.&nbsp; There is a shorthand we can use with dates, and which we will use frequently, for communicating that (see image below).&nbsp;&nbsp;</div><div><br></div><div>The chart below shows our first look at <span style=\"font-style: italic;\">regex</span>, a powerful took for conveying patterns to a computer.&nbsp; From the chart below, we use:</div><div>-&nbsp;&nbsp;<span style=\"font-family: Courier;\">\"%m\"</span> because our <span style=\"font-weight: bold;\">m</span>onths&nbsp; are formatted as numbers</div><div>- <span style=\"font-family: Courier;\">\"%d\"</span> because our <span style=\"font-weight: bold;\">d</span>ays are formatted as one OR two digits</div><div>- <span style=\"font-family: Courier;\">\"%Y\"</span> because our <span style=\"font-weight: bold;\">y</span>ear is formatted with all four digits</div><div><br></div><div>Since our date components are separated by slashes, we place slashes were they would be in our data between the regex symbols (the <span style=\"font-family: Courier;\">%m, %d</span>, and <span style=\"font-family: Courier;\">%Y</span> components).&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730747662463-DateTimeRegex.PNG","media/images/1730749645852-coffee_csv2.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"9bdbbe99-13dd-496f-8966-4c3b67def10d":[{"id":"bd0b63ee-e7f7-4077-a2f0-fa303c03e798","displayCommentEventId":"9bdbbe99-13dd-496f-8966-4c3b67def10d","displayCommentEventSequenceNumber":699,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730748323776,"commentText":"If reading in from Excel, we still need to change the formatting of our input.&nbsp; Here, we simply need to throw away the default date added to the time that was present in the<span style=\"font-family: Courier;\"> transaction_time</span> column.&nbsp; The start of this change is similar to things we've seen before, namely use mutate to reassign a value to a particular column.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"069a50a1-42a0-4a7e-a88a-dbd3e271da81":[{"id":"f2f60fee-0529-43fa-9eff-2be340c772f1","displayCommentEventId":"069a50a1-42a0-4a7e-a88a-dbd3e271da81","displayCommentEventSequenceNumber":762,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730748535149,"commentText":"We will need more regex in what is to come, so we pause here.&nbsp; The<span style=\"font-family: Courier;\"> format() </span>function is one we can use for extracting certain combinations of parts from a date-time object.&nbsp; It acts very similar to <span style=\"font-family: Courier;\">str_sub()</span> in many ways, and as such, it will output a character vector.&nbsp; Since we still want our objects viewed as date, time, or date-time objects whenever possible,&nbsp; we will convert our string back into a time object when we are done.&nbsp; That is what the <span style=\"font-family: Courier;\">as_hms()</span> function is for - converting a string to a time object.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["as_hms","format"],"questionCommentData":null}],"eebe705f-58f2-468c-92a6-f8b349798d9a":[{"id":"272f7846-6f6d-4568-ae88-5680d238219a","displayCommentEventId":"eebe705f-58f2-468c-92a6-f8b349798d9a","displayCommentEventSequenceNumber":784,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730748810571,"commentText":"The image below shows how our results/ data frame has changed now that we have made this specification.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730749683877-coffee_excel2.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["question","image"],"questionCommentData":{"allAnswers":["The time would not be read on a 24 hour clock","The hours might include 1 digit instead of two","An error would be created"],"correctAnswer":"An error would be created","question":"How would the results here have differed if we had used \"%h:%M:%S\" here?","explanation":"Be sure to check the tables, they try to be intuitive but they are not always. %h is not a regex command in our table; %I is how we specify things are not specified on a 24 hour clock."}}],"b493b8fb-0949-42c8-aa35-f7224301bc03":[{"id":"045ad8fa-9375-4b10-9d7f-da81f04f291d","displayCommentEventId":"b493b8fb-0949-42c8-aa35-f7224301bc03","displayCommentEventSequenceNumber":936,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730748959003,"commentText":"One huge benefit of the computer knowing that a column contains date or time data is that there are built in functions for doing the things we want to do with them!&nbsp; For example, the function <span style=\"font-family: Courier;\">wday()</span> takes in a date and outputs what number day of the week that date fell/falls on (1 = Monday, 2 = Tuesday, etc.).&nbsp; The code we have here will create a column called <span style=\"font-family: Courier;\">transaction_day </span>that gives us the day of the week that transaction occurred on as a number.&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"e6a5c5b5-ee4d-4cde-a8f6-818a1921c54e":[{"id":"055ea9c3-d9f1-4977-be5f-7255cf4185db","displayCommentEventId":"e6a5c5b5-ee4d-4cde-a8f6-818a1921c54e","displayCommentEventSequenceNumber":1024,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730749199059,"commentText":"The computer also knows how to order dates, so you can find the earliest/latest date in a column through calls to the <span style=\"font-family: Courier;\">min()</span> and <span style=\"font-family: Courier;\">max()</span> functions.&nbsp; Here, we see that our data includes information on every day of the year from January 1 of 2023 until June 30 of 2023.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["TRUE","FALSE"],"correctAnswer":"FALSE","question":"If d1 &lt;- <span style=\"font-family: Courier;\">\"2009-02-01\"</span> and d2 &lt;- <span style=\"font-family: Courier;\">\"2009-01-02\"</span> are strings / character vectors, what is the output of <span style=\"font-family: Courier;\">d1 &lt; d2</span>?","explanation":"The strings match until the 7th digit, but since 1 &lt; 2, d2 &lt; d1 as strings."}},{"id":"3a4d025b-3e12-4a8a-b6d7-84c9c8e65dc4","displayCommentEventId":"e6a5c5b5-ee4d-4cde-a8f6-818a1921c54e","displayCommentEventSequenceNumber":1024,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730749298616,"commentText":"","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["TRUE","FALSE"],"correctAnswer":"TRUE","question":"If d1 &lt;-&nbsp;<span style=\"font-family: Courier;\">\"2009-02-01\"</span>&nbsp;and d2 &lt;-&nbsp;<span style=\"font-family: Courier;\">\"2009-01-02\"</span>&nbsp;are dates formatted \"%Y-%d-%m\", what is the output of&nbsp;<span style=\"font-family: Courier;\">d1 &lt; d2</span>?","explanation":"<span style=\"font-family: Courier;\">d1 </span>translates to January 2, 2009, while <span style=\"font-family: Courier;\">d2</span> translates to February 1, 2009.&nbsp; Since January 2 comes before February 2 of the same year, this would be <span style=\"font-family: Courier;\">TRUE.</span>"}}],"8e57dcfb-757d-4f1f-9427-16c9ad65e8cd":[{"id":"72ad1aba-03cf-4622-8b08-64776b35423e","displayCommentEventId":"8e57dcfb-757d-4f1f-9427-16c9ad65e8cd","displayCommentEventSequenceNumber":1244,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730749605466,"commentText":"We can create a plot that shows how much business we've done on every day of the year.&nbsp; <span style=\"font-family: Courier;\">geom_freqpoly(</span>) is virtually the same as <span style=\"font-family: Courier;\">geom_bar()</span>, we just connect the tops of the bars with line segments and don't focus on filling in the bars.&nbsp; It is a common practice when you have continuous data to use <span style=\"font-family: Courier;\">geom_freqpoly()</span> and <span style=\"font-family: Courier;\">geom_bar() </span>for discrete / categorical data.<div><br></div><div>By using 181 bins, we create a peak for each day of the year.&nbsp; The image below shows the change in our sales over time time frame given.&nbsp; It looks like perhaps we have been looking at a new business - business seems to be growing!</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730749579838-freqpoly1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["geom_freqpoly","image"],"questionCommentData":null}],"f08ff629-a051-42f1-955c-b89aa282bd43":[{"id":"69196fa7-50c0-4d34-a6ed-5d615173d5a2","displayCommentEventId":"f08ff629-a051-42f1-955c-b89aa282bd43","displayCommentEventSequenceNumber":1404,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730749977630,"commentText":"It is so common to extract just one part of a date-time object that R has these functions built in.&nbsp; To obtain just the month part of a column including date-time objects, just use the <span style=\"font-family: Courier;\">month() </span>function.&nbsp; Similar things go for <span style=\"font-family: Courier;\">day(), hour(), minute()</span>, and <span style=\"font-family: Courier;\">year()</span>.<div><br></div><div>Notice that this graph is helpful, but everything is formatted numerically, how a computer likes it.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730749881869-DaysOfTheWeek1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["month()","image"],"questionCommentData":null}],"d9759623-e33f-4044-85e9-5d4f9c9b490f":[{"id":"ee97c603-4cfd-402c-a3c2-79aa185aff2d","displayCommentEventId":"d9759623-e33f-4044-85e9-5d4f9c9b490f","displayCommentEventSequenceNumber":1432,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730750094485,"commentText":"All functions that work with date-time data have a label argument that, if set to <span style=\"font-family: Courier;\">TRUE</span>, will format the data in a more human readable format.&nbsp; By setting the <span style=\"font-family: Courier;\">labels</span> in both the<span style=\"font-family: Courier;\"> wday() </span>and <span style=\"font-family: Courier;\">month()</span> functions to <span style=\"font-family: Courier;\">TRUE</span>, we insist that they take on the values as strings, not numbers.&nbsp; This is most helpful when graphing; numeric data is often more helpful for computations.&nbsp;<div><br></div><div>The graph below shows the output when we set the labels equal to <span style=\"font-family: Courier;\">TRUE</span>.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730750108300-DaysOfTheWeek2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"17abcb45-b378-4f78-a1c4-83e905d3e6d3":[{"id":"5411f148-f22d-4fa5-9648-514a075c1d6f","displayCommentEventId":"17abcb45-b378-4f78-a1c4-83e905d3e6d3","displayCommentEventSequenceNumber":1567,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730750480684,"commentText":"Another helpful function: <span style=\"font-family: Courier;\">ymd() </span>(which stands for <span style=\"font-weight: bold;\">y</span>ear, <span style=\"font-weight: bold;\">m</span>onth, <span style=\"font-weight: bold;\">d</span>ay) converts things as we would type them to date-time objects for the sake of comparison.&nbsp; Several variations on this function exist according to how you are passing in the data.&nbsp; For example, if we were to call<span style=\"font-family: Courier;\"> mdy(\"Jan 18 2024\")</span>, this would be converted to a date-time object that corresponds to January 18 or 2024.&nbsp; Powerfully, the date-time object for the previous example AND that of <span style=\"font-family: Courier;\">mdy(01182024)</span> would be the same!","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["mdy_hm()","ymd_hm()","dmy_hm()"],"correctAnswer":"mdy_hm()","question":"Which function would you use to convert the string <span style=\"font-family: Courier;\">\"10-31-2018 01:13\"</span> to a date-time object?","explanation":"You can also go as far as seconds!"}}],"b45df1bc-b4db-4f4e-9d3f-805be9f6ea0d":[{"id":"1982d846-f8fb-447b-b779-29f1bffb1da7","displayCommentEventId":"b45df1bc-b4db-4f4e-9d3f-805be9f6ea0d","displayCommentEventSequenceNumber":1735,"developerGroupId":"e3c03791-cfcc-4590-a75f-068f1cfdbd63","timestamp":1730750770661,"commentText":"We are free to take whichever pieces we need from whichever date-time columns we need.&nbsp; Here, we create a visual for every day of January plotting out the hours of the day when we see the most traffic in the shop.&nbsp; If this truly is a new business, this is helpful to hone in on busy times of the day.&nbsp; We can see from the graph below that we are most busy in the mornings, with business slowing down after 10:00 AM.&nbsp;&nbsp;<div><br></div><div>What other questions might we want to ask about the data?&nbsp; Could we zoom in on 15 minute time intervals during busing times to get a better picture?</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1730750716332-businessByHour.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/DatesAndTimes.R","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["Because we are looking at 24 days of data","Because there are 24 hours in the day","Because there are 24 different shops"],"correctAnswer":"Because there are 24 hours in the day","question":"Why is bins&nbsp; = 24 used here?","explanation":""}}]};
